import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#33126B', // Dark Purple
      contrastText: '#FAFAFA',
    },
    secondary: {
      main: '#FF0A91', // Hot Pink
      contrastText: '#FAFAFA',
    },
    background: {
      default: '#FAFAFA', // Light Gray
    },
  },
  typography: {
    fontFamily: 'Roboto, sans-serif',
  },
});

export default theme;
